import "./App.css";

function App() {
  async function test() {
    fetch("http://localhost:3001/forsinkelser")
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      })
      .catch((error) => {
        console.error(error);
      });
  }

  return (
    <div className="App">
      <button onClick={test}>TEST</button>
    </div>
  );
}

export default App;
